import { SearchOutlined } from '@ant-design/icons';
import 'antd/dist/antd.min.css'
import { Button} from 'antd';
import React, { Component } from 'react'
import Contents from './Contents/index'
import './index.css'
import { Route,Routes,NavLink, Navigate, useRoutes } from 'react-router-dom';

export default class Home extends Component {
  render() {
    const element=useRoutes(routes);
    return (
      <div className="home">
        <div className="home-subnav">
          <ul className="home-subnav-left">
            {/* all */}
            <li><NavLink to="/Contents">全部</NavLink></li>
            {/* infoManage */}
            <li><NavLink to="/Contents">信息管理</NavLink></li>
            {/* rdDesign */}
            <li><NavLink to="/Contents">研发设计</NavLink></li>
            {/* productControl */}
            <li><NavLink to="/Contents">生产控制</NavLink></li>
            {/* Firmware */}
            <li><NavLink to="/Contents">嵌入式软件</NavLink></li>
          </ul>
          <div className="home-subnav-right">
            <input type="text" placeholder='搜索'/>
            <Button shape="circle" icon={<SearchOutlined />} />
          </div>
        </div>
        {/* <Routes>
          <Route path="/Contents" element={<Contents/>}/>
          <Route path="/" element={<Navigate to="/Contents"/>}/>
        </Routes> */}
        {elelment}
      </div>
    )
  }
}
